import React from 'react';
import "../styles/show.css";

export default function ShowPost() {
  return (
    <div className="show-post">
      <div className="show-wrapper">
        <img className="show-img" src="https://images.pexels.com/photos/261579/pexels-photo-261579.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940" alt="studies & coffee" />
        <h1 className="show_title">Lorem, ipsum dolor sit amet consectetur adipisicing elit.</h1>
        <div className="show-edit-delete">
          <i className="show-edit far fa-edit"></i>
          <i className="show-delete far fa-trash-alt"></i>
        </div>
        <div className="show-info">
          <span className="show-info-author">Author: <b>Name</b></span>
          <span className="show-info-date">Date: ${new Date.toLocalString()}</span>
        </div>
      </div>
    </div>
  )
}
